INSERT INTO `artikel` (`id_artikel`, `id_user`, `judul`, `gambar`, `tanggal`, `keterangan`, `status`) VALUES
(4, 9, 'Bootstrap adalah framework HTML, CSS, dan JavaScript yang berfungsi untuk mendesain website responsive dengan cepat dan mudah.', 'pexels-photo-1049298.jpeg', '2023-06-02', '<p>Bootstrap adalah kerangka kerja CSS yang sumber terbuka dan bebas untuk merancang situs web dan aplikasi web. Kerangka kerja ini berisi templat desain berbasis HTML dan CSS untuk tipografi, formulir, tombol, navigasi, dan komponen antarmuka lainnya, serta juga ekstensi opsional JavaScript.&nbsp;</p>', '1');
