INSERT INTO `pengumuman` (`id_pengumuman`, `id_user`, `judul`, `tanggal`, `pengumuman`) VALUES
(1, 9, 'Lomba 17 Agustus 2023', '2023-06-04', '<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(0, 0, 0);font-family:Arial, Helvetica, Tahoma;font-size:17px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:20px;margin-top:0px;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><span style=\"box-sizing:border-box;\">Panjat pinang adalah salah satu lomba khas yang paling dinanti pada 17 Agustus. Pasalnya, lomba ini memerlukan kekompakan beberapa orang yang diharuskan memanjat batang pohon pinang untuk mendapatkan banyak hadiah menarik. Namun, lomba ini tidak mudah karena batang pohon pinang sudah dilumuri dengan oli bekas atau pelicin lain yang menyulitkan peserta.</span></p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(0, 0, 0);font-family:Arial, Helvetica, Tahoma;font-size:17px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:20px;margin-top:0px;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><span style=\"box-sizing:border-box;\">Jika panjat pinang yang dilakukan bapak-bapak dirasa </span><em style=\"box-sizing:border-box;\"><i>mainstream</i></em><span style=\"box-sizing:border-box;\">, cobalah ganti dengan peserta yang mengharuskan ibu-ibu memanjat batang pohon pinang tersebut. Selain itu, Anda juga bisa memilih opsi panjat pinang untuk anak-anak SD atau SMP yang juga tak kalah seru dan meriah. Namun, pastikan batang pohon pinang lebih pendek dan dikelilingi oleh panitia yang menjaga keamanan anak-anak peserta lomba.</span></p>');
